import React from "react";
import { useSelector } from "react-redux";
import Post from "../components/Post";

const Home = () => {
  const { user } = useSelector((state) => state.user);
  return (
    <div className="home">
      <h1>Welcome, {user?.username || "Guest"}</h1>
      <div className="posts">
        <Post />
        <Post />
        <Post />
        <Post />
      </div>
    </div>
  );
};

export default Home;
